import React from "react";
import { RecipeCard } from "./RecipeCard";

interface PopularSectionProps {
  title: string;
  icon: string;
  items: Array<{
    image: string;
    title: string;
    price: string;
    rating: number;
    quantity: string;
    description: string;
    imageAlt?: string;
  }>;
}

export const PopularSection: React.FC<PopularSectionProps> = ({
  title,
  icon,
  items,
}) => {
  return (
    <section className="w-full">
  <div className="flex items-center gap-2 mt-12 ml-14 text-4xl font-bold text-black max-md:mt-10 max-md:ml-2.5">
    <img
      src={icon}
      alt=""
      className="object-contain w-10 h-10"
    />
    <h2>{title}</h2>
  </div>

  <div className="px-14 mt-4 w-full max-md:px-4">
    <div className="flex flex-wrap gap-5 justify-start">
      {items.map((item, index) => (
        <div
          key={index}
          className="basis-1/4 max-lg:basis-1/2 max-sm:basis-full flex-grow-0 shrink-0"
        >
          <RecipeCard {...item} />
        </div>
      ))}
    </div>
  </div>
</section>

  );
};
